window.bookSummaryJSON = "<p><b>From the gutter to the stars....</b></p> <p>Dance is in my blood. It’s what keeps me sane, out of trouble. It used to keep them out of trouble, too - a group of boys I grew up with. Xeno, York, Zayn, and Dax.</p> <p>We were a crew once. and we ruled the clubs. Separately we were insanely good; together we were unbeatable. F--king on fire. I was their girl, and they were my breakers. Until they did something they promised they never would: broke my heart.</p> <p>We were 17 when they left me. You see, for kids like us, dance was all we had. Growing up in a rundown housing estate in London with no prospects can make you view the world differently. It can make you choose the wrong path. I chose dance, and they chose crime.</p> <p>Three years later, I’ve won a scholarship to Stardom Academy. I try to forget my past. But how can I do that when the four boys who hurt me are back?</p> <p>And this time, they’re following in my footsteps and joining the academy, too.</p> <p><b><i>Freestyle</i></b><b> is book one of Academy of Stardom, a gritty, contemporary reverse-harem romance. If you love dance, your men on the criminal side, alpha hot holes, and the friends-to-enemies-to-lovers trope, this is for you. Contains mature themes and ends on a cliff-hanger.</b></p>"; 
